import React from 'react';
import './cardlist.css';
import './card';
import Card from './card';

const CardList = props => {
    return <div className= 'cardlist'>
                        {props.ccard.map(ccard=>(
            <Card key={ccard.id} ccard={ccard}/>
          ))}
    </div>
};

export default CardList;
